=\"3f89b327-3628-43b8-b7ec-77083bef0971\">\n               <startdate uuid=\"d51f8058-c872-45e1-a02d-6e21c59c997e\">\n        19900101\n      </startdate>\n               <stopdate uuid=\"d6dc2632-b8b7-49a4-9aa1-7bbd30863fe1\">\n        20111231\n      </stopdate>\n          </period>\n          <description>\n      Clostridium difficile, also known as \"C. diff,\" is a species of bacteria that causes severe diarrhea and other intestinal disease when competing bacteria in the gut have been wiped out by antibiotics (see Wikipedia entry). In rare cases a C. diff infection can progress to toxic megacolon which can be life-threatening. In a very small percentage of the adult population C. difficile bacteria naturally reside in the gut. Other people accidentally ingest spores of the bacteria while patients in a hospital or nursing home.\nThe EMR phenotype definition below includes two separate algorithms&#8212;one relying on inpatient data and the other on outpatient data. The algorithm for inpatient data was developed primarily by Vanderbilt. The outpatient algorithm was developed primarily by Group Health/UW.\n    </description>\n          <copyright>\n      Developed by Group Health and Vanderbilt University\nThis algorithm was implemented in MAT for testing purposes only, and should not be used or shared.\n    </copyright>\n          <setid>\n      d331e926-fd70-43eb-95fd-ae1949c20af7\n    </setid>\n          <status>\n      InProgress\n    </status>\n          <authors>\n               <author id=\"73f2de7f-fadd-478b-8b2d-5b7f822d46a8\">\n        Group Health\n      </author>\n               <author id=\"58e3d115-5740-45bf-b6fc-649d98ee1eb1\">\n        Vanderbilt University\n      </author>\n          </authors>\n          <custodian id=\"6dd2e729-9424-4b21-b541-50d13f355a96\">\n      Group Health Cooperative\n    </custodian>\n          <verifiers>\n               <verifier>\n        None\n      </verifier>\n          </verifiers>\n          <scores>\n             