   <author id=\"9745825d-c3fc-437d-8738-f452fba523b0\">\n        Group Health Cooperative\n      </author>\n               <author id=\"397f170e-bc8b-4e50-b1f2-ae95bdeb8036\">\n        Vanderbilt University\n      </author>\n          </authors>\n          <custodian id=\"88d4f97a-f744-4368-b293-e058a1b9f478\">\n      Group Health Cooperative\n    </custodian>\n          <verifiers>\n               <verifier>\n        None\n      </verifier>\n          </verifiers>\n          <scores>\n               <score id=\"CONTVAR\">\n        Continuous Variable\n      </score>\n          </scores>\n          <types>\n               <type id=\"OUTCOME\">\n        Outcome\n      </type>\n          </types>\n          <stratification>\n      eMERGE site, gender, age, race, ethnicity\n    </stratification>\n          <guidance>\n      n/a\n    </guidance>\n          <transmissionFormat>\n      CSV file\n    </transmissionFormat>\n          <rationales>\n               <rationale>\n        n/a\n      </rationale>\n          </rationales>\n          <recommendations>\n               <recommendation>\n        n/a\n      </recommendation>\n          </recommendations>\n          <references>\n               <reference>\n        n/a\n      </reference>\n          </references>\n          <improvementNotation>\n      n/a\n    </improvementNotation>\n          <definitions>\n               <definition>\n        1. Cases\n\n1.1 Labs (gold standard)\n\n1.1.1. Lab Antigen Test\n\nAnyone ?2 years of age with at least one positive inpatient C. diff antigen test (cytotoxicity assay). \n\n1.1.2. Lab Toxin Test\n\nAnyone ?2 years of age with at least one positive Toxin ELISA test for either A strain or B strain or A and B strains. \n\n1.2. Diagnoses (silver standard)\n\n1.2.1. Diagnoses and Medications\n\nAnyone ?2 years of age with the following sequence of diagnosis codes and medications:\n\nWithin a 90-day period the subject has:\n1) one or more days with an inpatient or outpatient diagnosis of C. diff, followed by\n2) one or more days with a dispensed medication for treating C. diff, followed by\n3) one or more days with an inpatient or outpatient diagnosis of C. diff.\n\nThe diagnosis codes for C. diff are:\n\n008.45*\n\nThe medications for treating C. diff are:\n\nMetronidazole\nVancomycin (oral)\nFidaxomicin\nLinezolid\n\n1.2.2. Diagnoses  and Progress Note Mentions\n\nAnyone ?2 years of age with:\n\nAt least on diagnosis code for C. diff (see above) and at least one non-negated, non-historical, non-uncertain mention of C. diff infection in progress notes.\n\nC. diff mentions include:\n\n1.	difficile colitis\n2.	diff colitis\n3.	dif colitis\n4.	difficile diarrhea\n5.	diff diarrhea\n6.	dif diarrhea\n7.	difficile infection\n8.	diff infection\n9.	dif infection\n10.	difficile enteritis\n11.	diff enteritis\n12.	dif enteritis\n\nNote that omission of &#8220;clostridium&#8221; and its abbreviations from the dictionary entries simplified implementation at Group Health (the commonly used abbreviation &#8220;C.&#8221; is difficult to implement in cTAKES) and did not reduce specificity. \n\n1.3. Progress Note Mentions (silver standard)\n\nAnyone ?2 years of age with:\n\nAt least two non-negated, non-historical, non-uncertain mentions of C. diff infection (see above) in progress notes recorded on  ?2 calendar days. (May increase to ?3 calendar days to increase specificity).\n\n2. Controls\n\nThe desired ratio of controls to cases when combining data from all sites is 2:1. \n\nThere are also two parts to the definition of controls, depending on whether the data is from the inpatient or outpatient setting.\n\n2.1 Hospital Admission, Diagnoses, Labs and Medications\n\nAnyone ?2 years of age who:\n\n1) has at least one hospital admission, and\n2) has been exposed to a class 2 (moderate risk for C. diff) or class 3 (high risk for C. diff) antibiotic 7-62 days before the hospital admission, and \n3) has no diagnosis codes for C. diff (see above), and \n4) has never been tested for C. diff (antigen or toxin, see above)\n\nClass 2 and Class 3 antibiotics include:\n\n[add definition]\n\nThe rationale for not using negative C diff. antigen/toxin testing as a definition for controls is as follows. Lab tests are only ~60-70% sensitive. This means that a single test does not rule out the disease. Further, requiring multiple negative tests did not seem like a viable strategy for identifying controls because such a pattern of testing may signal a concern that the disease exists but is not being detected by the lab test.\n\nMatching of cases and controls by age and race will be handled analytically after genotyping (needs discussion).\n\n2.2.  Progress Notes, Diagnoses, Labs and Medications\n\nAnyone ?2 years of age who:\n\n1) has evidence of exposure to class 2 or class 3 antibiotics, and\n2) has continuous enrollment for 5 or more years following this antibiotic exposure, and\n3) has no diagnosis codes for C. diff (ever), and\n4) has no mentions in progress notes of C. diff (ever).\n      </definition>\n          </definitions>\n          <qualityMeasureSet uuid=\"4a102344-81d6-49dd-99c2-11caa3bb5f18\">\n      n/a\n    </qualityMeasureSet>\n          <supplementalData>\n      n/a\n    </supplementalData>\n          <disclaimer>\n      This algorithm is in development\n    </disclaimer>\n          <riskAdjustment>\n      n/a\n    </riskAdjustment>\n          <aggregation>\n      n/a\n    </aggregation>\n          <initialPatientPopDescription>\n      Individuals consented to, and actively enrolled in the institutional biobank\n    </initialPatientPopDescription>\n          <denominatorExclusionsDescription>\n      n/a\n    </denominatorExclusionsDescription>\n          <numeratorDescription>\n      n/a\n    </numeratorDescription>\n          <numeratorExclusionsDescription>\n      n/a\n    </numeratorExclusionsDescription>\n          <denominatorExceptionsDescription>\n      n/a\n    </denominatorExceptionsDescription>\n          <measurePopulationDescription>\n      See Definition\n    </measurePopulationDescription>\n          <measureObservationsDescription>\n      n/a\n    </measureObservationsDescription>\n          <denominatorDescription>\n      n/a\n    </denominatorDescription>\n          <nqfid root=\"2.16.840.1.113883.3.560.1\" extension=\"eMERGE-CDIFF-V2\"/>\n     \r\n<version>0</version>\r\n</headers>\n     <elementlookup>\n          <qdsel id=\"2068\" codesystemname=\"HL7\" codesystem=\"2.16.840.1.113883.3.1427\" oid=\"2.16.840.1.113883.1.11.1\" name=\"Gender\" uuid=\"054ff7fd-5201-45a9-8f59-60700dbbc51a\" datatype=\"Patient Characteristic\" taxonomy=\"HL7 (2.16.840.1.113883.5.1)\"/>\n          <qdsel id=\"2069\" codesystemname=\"CDC NCHS\" codesystem=\"2.16.840.1.113883.3.1427\" oid=\"2.16.840.1.114222.4.11.836\" name=\"Race\" uuid=\"a6a796ee-9661-40dc-8607-90c5714e8198\" datatype=\"Patient Characteristic\" taxonomy=\"CDC\"/>\n          <qdsel id=\"2070\" codesystemname=\"CDC NCHS\" codesystem=\"2.16.840.1.113883.3.1427\" oid=\"2.16.840.1.114222.4.11.837\" name=\"Ethnicity\" uuid=\"efa73ffc-bfcb-4043-9d08-895414a2d694\" datatype=\"Patient Characteristic\" taxonomy=\"CDC\"/>\n          <qdsel id=\"2071\" codesystemname=\"PHDSC\" codesystem=\"2.16.840.1.113883.3.1427\" oid=\"2.16.840.1.113883.221.5\" name=\"Payer\" uuid=\"a7f9c63c-7c37-4984-a37f-e37eb55b0fcc\" datatype=\"Patient Characteristic\" taxonomy=\"Source of Payment Typology\"/>\n          <qdsel id=\"2072\" codesystemname=\"Group Health Cooperative\" codesystem=\"2.16.840.1.113883.3.1427\" oid=\"2.16.840.1.113883.360\" name=\"Clostridium Difficile Laboratory Tests (v2)\" uuid=\"82d6c238-ab39-4d6d-82bf-09c63de1371c\" datatype=\"Laboratory Test, Result\" taxonomy=\"Grouping\"/>\n          <qdsel id=\"2075\" codesystemname=\"Group Health Cooperative\" codesystem=\"2.16.840.1.113883.3.1427\" oid=\"2.16.840.1.113883.363\" name=\"Clostridium Difficile - Text Mentions\" uuid=\"1d364048-31ba-4e20-9f4a-214a524e34d4\" datatype=\"Diagn