elow includes two separate algorithmsâ??one relying on inpatient data and the other on outpatient data. The algorithm for inpatient data was developed primarily by Vanderbilt. The outpatient algorithm was developed primarily by Group Health/UW.','8a4d92b23512a4020135592a69860960'),('8a4d92b2356da09e01359c62e4810101','MeasureToPeriod','12/31/2011','8a4d92b23512a4020135592a69860960'),('8a4d92b2356da09e01359c62e4810102','ClinicalRecomms','-','8a4d92b23512a4020135592a69860960'),('8a4d92b2356da09e01359c62e4810103','MeasureSteward','Other','8a4d92b23512a4020135592a69860960'),('8a4d92b2356da09e01359c62e4810104','InitialPatientPopulation','-','8a4d92b23512a4020135592a69860960'),('8a4d92b2356da09e01359c62e4820105','MeasureStatus','InProgress','8a4d92b23512a4020135592a69860960'),('8a4d92b2356da09e01359c62e4820106','Numerator','-','8a4d92b23512a4020135592a69860960'),('8a4d92b2356da09e01359c62e4820107','Name','Clostridium Difficile (C. diff) Phenotype Algorithm - Cases','8a4d92b23512a4020135592a69860960'),('8a4d92b2356da09e01359c62e4820108','SupplementalDataElements','-','8a4d92b23512a4020135592a69860960'),('8a4d92b2356da09e01359c62e4820109','Denominator','-','8a4d92b23512a4020135592a69860960'),('8a4d92b2356da09e01359c62e482010a','MeasurePopulation','-','8a4d92b23512a4020135592a69860960'),('8a4d92b2356da09e01359c62e482010b','RiskAdjustment','-','8a4d92b23512a4020135592a69860960'),('8a4d92b2356da09e01359c62e482010c','ShortName','eMERGE C. diff - Cases','8a4d92b23512a4020135592a69860960'),('8a4d92b2356da09e01359c62e482010d','SetName','-','8a4d92b23512a4020135592a69860960'),('8a4d92b2356da09e01359c62e482010e','Disclaimer','The algortihm proposed here has not been fully verified, nor is the implementation guaranteed to follow best measure authoring practices as envisioned by the NQF.','8a4d92b23512a4020135592a69860960'),('8a4d92b2356da09e01359c62e482010f','Author','Group Health','8a4d92b23512a4020135592a69860960'),('8a4d92b2356da09e01359c62e4820110','Author','Vanderbilt University'