2356da09e01359c679bf60113'),('8a4d92b2356da09e0135a6baed952b6a','DenominatorExeptions','n/a','8a4d92b2356da09e01359c679bf60113'),('8a4d92b2356da09e0135a6baed952b6b','Copyright','(n/a)','8a4d92b2356da09e01359c679bf60113'),('8a4d92b2356da09e0135a6baed952b6c','Definitions','1. Cases\n\n1.1 Labs (gold standard)\n\n1.1.1. Lab Antigen Test\n\nAnyone ?2 years of age with at least one positive inpatient C. diff antigen test (cytotoxicity assay). \n\n1.1.2. Lab Toxin Test\n\nAnyone ?2 years of age with at least one positive Toxin ELISA test for either A strain or B strain or A and B strains. \n\n1.2. Diagnoses (silver standard)\n\n1.2.1. Diagnoses and Medications\n\nAnyone ?2 years of age with the following sequence of diagnosis codes and medications:\n\nWithin a 90-day period the subject has:\n1) one or more days with an inpatient or outpatient diagnosis of C. diff, followed by\n2) one or more days with a dispensed medication for treating C. diff, followed by\n3) one or more days with an inpatient or outpatient diagnosis of C. diff.\n\nThe diagnosis codes for C. diff are:\n\n008.45*\n\nThe medications for treating C. diff are:\n\nMetronidazole\nVancomycin (oral)\nFidaxomicin\nLinezolid\n\n1.2.2. Diagnoses  and Progress Note Mentions\n\nAnyone ?2 years of age with:\n\nAt least on diagnosis code for C. diff (see above) and at least one non-negated, non-historical, non-uncertain mention of C. diff infection in progress notes.\n\nC. diff mentions include:\n\n1.	difficile colitis\n2.	diff colitis\n3.	dif colitis\n4.	difficile diarrhea\n5.	diff diarrhea\n6.	dif diarrhea\n7.	difficile infection\n8.	diff infection\n9.	dif infection\n10.	difficile enteritis\n11.	diff enteritis\n12.	dif enteritis\n\nNote that omission of â??clostridiumâ? and its abbreviations from the dictionary entries simplified implementation at Group Health (the commonly used abbreviation â??C.â? is difficult to implement in cTAKES) and did not reduce specificity. \n\n1.3. Progress Note Mentions (silver standard)\n\nAnyone ?2 years of age with:\n\nAt least two non-negated, non-historical, non-uncertain mentions of C. diff infection (see above) in progress notes recorded on  ?2 calendar days. (May increase to ?3 calendar days to increase specificity).\n\n2. Controls\n\nThe desired ratio of controls to cases when combining data from all sites is 2:1. \n\nThere are also two parts to the definition of controls, depending on whether the data is from the inpatient or outpatient setting.\n\n2.1 Hospital Admission, Diagnoses, Labs and Medications\n\nAnyone ?2 years of age who:\n\n1) has at least one hospital admission, and\n2) has been exposed to a class 2 (moderate risk for C. diff) or class 3 (high risk for C. diff) antibiotic 7-62 days before the hospital admission, and \n3) has no diagnosis codes for C. diff (see above), and \n4) has never been tested for C. diff (antigen or toxin, see above)\n\nClass 2 and Class 3 antibiotics include:\n\n[add definition]\n\nThe rationale for not using negative C diff. antigen/toxin testing as a definition for controls is as follows. Lab tests are only ~60-70% sensitive. This means that a single test does not rule out the disease. Further, requiring multiple negative tests did not seem like a viable strategy for identifying controls because such a pattern of testing may signal a concern that the disease exists but is not being detected by the lab test.\n\nMatching of cases and controls by age and race will be handled analytically after genotyping (needs discussion).\n\n2.2.  Progress Notes, Diagnoses, Labs and Medications\n\nAnyone ?2 years of age who:\n\n1) has evidence of exposure to class 2 or class 3 antibiotics, and\n2) has continuous enrollment for 5 or more years following this antibiotic exposure, and\n3) has no diagnosis codes for C. diff (ever), and\n4) has no mentions in progress notes of C. diff (ever).','8a4d92b2356da09e01359c679bf60113'),('8a4d92b2356da09e0135a6baed952b6d','ImprovNotations','n/a','8a4d92b2356da09e01359c679bf60113'